import React from 'react';
import {Link} from 'react-router-dom';
import {Card, CardContent, CardMedia, Typography} from '@mui/material';
import {CheckCircle} from "@mui/icons-material";
import {demoChannelUrl, demoVideoUrl, demoVideoTitle, demoChannelTitle,demoThumbnailUrl} from "../utils/constants";


function VideoCard({video:{id:{vidoeId}, snippet}}) {
    console.log(vidoeId)
    return (
        <Card sx={{width:{md:'302px', xs:'100%'}, boxShadow:'none', borderRadius:'none'}}>
            <Link to={vidoeId ? `/video/${vidoeId}` : demoVideoUrl}>
                <CardMedia
                    image ={snippet?.thumbnails?.high?.url}
                    alt={snippet?.title}
                    sx={{width: 358, height: 180}}/>
            </Link>
            <CardContent sx={{backgroundColor: '#1e1e1e', height: '106px'}}>
                <Link to={vidoeId ? `/video/${vidoeId}` : demoVideoUrl}>
                    <Typography variant='sbtitle1' fontWeight='bold' color='#FFF'>
                        {snippet?.title.slice(0, 60) || demoVideoTitle.slice(0, 60)}
                    </Typography>
                </Link>
                <Link to={snippet?.channelId ? `/channel/${snippet?.channelId}` : demoChannelUrl}>
                    <Typography variant='sbtitle1' fontWeight='bold' color='#FFF'>
                        {snippet?.channelTitle || demoChannelTitle}
                        <CheckCircle sx={{fontSize:12, color:"gray", ml:"5px"}}/>
                    </Typography>
                </Link>
            </CardContent>
        </Card>
    );
}

export default VideoCard;
